script: |
  super -f text -I q8551.spq | sort > q8551.out

inputs:
  - name: q8551.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 / col2 NOT IN ( + col0 * - col2 * col2 + - cor0.col1 );
  - name: tab0

outputs:
  - name: q8551.out
    data: |
      24	86	33
      35	97	1
      89	91	82
